
# port: 7890
# socks-port: 7891
mixed-port: 10801
redir-port: 9797
mode: rule
allow-lan: true
unified-delay: false
bind-address: '*'
log-level: debug
ipv6: true
geo-auto-update: true
geo-update-interval: 24 
external-controller: 0.0.0.0:9090 
external-ui: /data/adb/box/clash/dashboard/metacubexd
external-ui-name: xd
external-ui-url: "https://github.com/MetaCubeX/metacubexd/archive/refs/heads/gh-pages.zip"
tcp-concurrent: true
global-client-fingerprint: chrome
geox-url:
  geoip: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/release/geoip.dat"
  geosite: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/release/geosite.dat"
  mmdb: "https://raw.githubusercontent.com/Chocolate4U/Iran-clash-rules/release/geoip.metadb"
  asn: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/geolite2/GeoLite2-ASN.mmdb"
find-process-mode: always
profile:
  store-selected: true
  store-fake-ip: true
interface-name: rmnet0
keep-alive-interval: 15 

sniffer:
  enable: true
  sniffing:
    - tls
    - http
  skip-domain:
    - 'Mijia Cloud'
    - 'dlg.io.mi.com'
    - '+.apple.com'
    - '*.baidu.com'
  force-domain:
    - '+'
    - '+.google.com'
  port-whitelist:
    - 80
    - 443
    - 8000-9000
tun:
  enable: true
  stack: MIXED
#system # gvisor / lwip
  dns-hijack:
    - any:53
    - any:5353
    - tcp://any:53
  # interface-name: 
  auto-route: true 
  auto-detect-interface: true 
  mtu: 9000 
  strict_route: true 
  inet4_route_address: 
    - 0.0.0.0/1
    - 128.0.0.0/1
  inet6_route_address: 
    - '::/1'
    - '8000::/1'
  endpoint_independent_nat: true 
dns:
  enable: true
  ipv6: true
  listen: '0.0.0.0:1053'
  enhanced-mode: fake-ip
  fake-ip-range: 28.0.0.0/8
  nameserver:
    - tcp://223.5.5.5
    - tcp://8.8.8.8
    - tcp://1.1.1.1
    - udp://1.1.1.1
    - udp://223.6.6.6
    - udp://119.29.29.29
    - udp://8.8.8.8
    - udp://114.114.114.114
  fallback:
    - udp://223.5.5.5:853
    - https://223.5.5.5/dns-query
    - udp://1.0.0.1
    - udp://8.8.4.4
  fallback-filter:
    geoip: true
    geoip-code: ir
    ipcidr:
      - 240.0.0.0/4
    domain:
      - '+.google.com'
      - '+.facebook.com'
      - '+.youtube.com'
      - '+.telegram.com'
      - '+.instagram.com'

