      - 🍆
      - 🔯
  - name: U
    type: fallback
    url: http://www.gstatic.com/generate_204
    interval: 120
    tolerance: 100
#    include-all-proxies: true
    proxies:
      - 🍆
      - 🔯
      - PROXY
  - name: PROXY
    type: select
    include-all-proxies: true
    proxies:
      - U
      - 🍆
      - DIRECT
 

  - name: 🍆
    type: url-test
    url: http://www.gstatic.com/generate_204
    interval: 120
    tolerance: 100
    include-all-proxies: true
    proxies:

  - name: 🔯
    type: fallback
    url: http://www.gstatic.com/generate_204
    interval: 180
    include-all-proxies: true
    proxies:


  - name: 🎯
    type: select
    proxies:
      - DIRECT
      - PROXY
      - 🐝
